/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `sport_community`.`schedule_AFTER_UPDATE` AFTER UPDATE ON `schedule` FOR EACH ROW
BEGIN
	declare match_played_new int;
	declare match_played_old int;
    set match_played_new = (select played from `match` where id = new.match_id);
    set match_played_old = (select played from `match` where id = old.match_id);
    
    if ifnull(match_played_new, 0) = 2 or ifnull(match_played_old, 0) = 2 then
			SIGNAL SQLSTATE '02000' SET MESSAGE_TEXT = 'The match was played';
    else
		update `match`
		set played = 0
		where id = old.match_id;
        
		update `match`
		set played = 1
		where id = new.match_id;

    end if;
END */;;
