CREATE DEFINER=`root`@`localhost` PROCEDURE `addActionRedCard`(a_match_id BIGINT, a_player_id INT, a_time_action VARCHAR(5))
BEGIN
	declare l_action_card INT;
	DECLARE l_team_id INT;
    DECLARE l_available_cards INT;
    DECLARE l_current_cards INT;
    SET l_action_card = (select a.id from `action` a where a.action_name = 'Красная карточка');
    SET l_team_id = (select pm.team_id from player_in_match pm where pm.match_id = a_match_id and pm.player_id = a_player_id);
    SET l_available_cards = 1;
    SET l_current_cards = (select count(1) 
						   from player_in_match pm, action_in_match am
                           where pm.match_id = a_match_id 
							 and pm.team_id = l_team_id
							 and pm.match_id = am.match_id
                             and pm.player_id = am.player_id
							 and am.action_id = l_action_card 
                             and am.player_id = a_player_id
                             group by am.action_id);
    
    IF (l_team_id is not null) THEN
		IF (ifnull(l_current_cards,0) < l_available_cards) THEN 
			insert into action_in_match (match_id, player_id, time, action_id)
			values (a_match_id, a_player_id, a_time_action, l_action_card);
        ELSE
			SIGNAL SQLSTATE '02000' SET MESSAGE_TEXT = 'Red cards enough';
        END IF;
    ELSE
		SIGNAL SQLSTATE '02000' SET MESSAGE_TEXT = 'Player not played';
    END IF;
END ;;
