CREATE DEFINER=`root`@`localhost` PROCEDURE `matchAddResult`(a_match_id BIGINT, a_goals_home INT, a_goals_guest INT)
BEGIN
	update `match`
	set goals_home = a_goals_home,
		goals_guest = a_goals_guest,
        played = 2
	where id = a_match_id;
    
END ;;
